    public function getProfiles()
    {
        return $this->profiles;
    }

    public function getProfile($index)
    {
        foreach($this->profiles as $ynp=>$profile) {
            if ($ynp == $index) {
                return (array)$profile;
            }
        }
        return [];
    }

    public function setProfiles($profiles)
    {
        $this->profiles = $profiles;
    }

    function fill($ynp) {
        $profile = $this->getProfile((int)$ynp);
        if (count($profile)) {
            Profile::updateAll(
                [
                    'legal_address' => $profile['c'],
                    'settlement_account' => $profile['b'],
                ],
                'ynp = :ynp',
                [':ynp' => $ynp]
            );
        }
    }

    function getFirmNameAndEmail($ynp) {
        $profile = $this->getProfile((int)$ynp);
        return json_encode([
            'email' => $profile['d'],
            'firm' => $profile['a'],
        ]);
    }

